sB("common/bench.effekt",'module bench\n\ntype Nanos \x3d Int\n\n/// The current time (since UNIX Epoch) in nanoseconds.\n///\n/// The actual precision varies across the different backends.\n/// - js: Milliseconds\n/// - chez: Microseconds\nextern def timestamp() at io: Nanos \x3d\n  js "Date.now() * 1000000"\n  chez "(timestamp)"\n  llvm !!!MULTILINEMARKER!!!\n    %time_ptr \x3d alloca { i64, i64 }\n    call i32 @clock_gettime(i32 0, ptr %time_ptr)\n    %time \x3d load {i64, i64}, ptr %time_ptr\n    %time_seconds \x3d extractvalue {i64, i64} %time, 0\n    %time_nanoseconds \x3d extractvalue {i64, i64} %time, 1\n    %time_seconds_nanoseconds \x3d mul nsw i64 %time_seconds, 1000000000\n    %result \x3d add nsw i64 %time_seconds_nanoseconds, %time_nanoseconds\n    ret %Int %result\n  !!!MULTILINEMARKER!!!\n\nextern llvm !!!MULTILINEMARKER!!!\n  declare i32 @clock_gettime(i32, ptr)\n!!!MULTILINEMARKER!!!\n\n// This should not be needed when using NodeJS 16.x or newer.\nextern jsNode !!!MULTILINEMARKER!!!\n  const { performance } \x3d require(\'node:perf_hooks\');\n!!!MULTILINEMARKER!!!\n\n/// High-precision timestamp in nanoseconds that should be for measurements.\n///\n/// This timestamp should only be used for **relative** measurements,\n/// as gives no guarantees on the absolute time (unlike a UNIX timestamp).\nextern def relativeTimestamp() at io: Nanos \x3d\n  js "Math.round(performance.now() * 1000000)"\n  default { timestamp() }\n\ntype Duration \x3d Int\n\nnamespace Duration {\n  def diff(fromNanos: Nanos, toNanos: Nanos): Duration \x3d toNanos - fromNanos\n}\n\n/// Runs the block and returns the time in nanoseconds\ndef timed { block: \x3d\x3e Unit }: Duration \x3d {\n  val before \x3d relativeTimestamp()\n  block()\n  val after \x3d relativeTimestamp()\n  Duration::diff(before, after)\n}\n\ndef measure(warmup: Int, iterations: Int) { block: \x3d\x3e Unit }: Unit \x3d {\n  def run(n: Int, report: Bool): Unit \x3d {\n    if (n \x3c\x3d 0) { () } else {\n      val time \x3d timed { block() };\n      if (report) { println(time) } else { () };\n      run(n - 1, report)\n    }\n  }\n  run(warmup, false)\n  run(iterations, true)\n}\n\n/// Takes a duration in nanoseconds and formats it in milliseconds with precision of two decimal digits.\ndef formatMs(nanos: Nanos): String \x3d {\n  val micros \x3d nanos / 1000000\n  val sub \x3d (nanos.mod(1000000).toDouble / 10000.0).round\n\n  if (sub \x3d\x3d 100) {\n    // overflow because of rounding\n    (micros + 1).show ++ ".0ms"\n  } else {\n    micros.show ++ "." ++ sub.show ++ "ms"\n  }\n}\n');
sB("common/stringbuffer.effekt",'module stringbuffer\n\nimport effekt\nimport bytearray\n\ninterface StringBuffer {\n  def write(str: String): Unit\n  def flush(): String\n}\n\ndef stringBuffer[A] { prog: \x3d\x3e A / StringBuffer }: A \x3d {\n  val initialCapacity \x3d 128\n  var buffer \x3d bytearray::allocate(initialCapacity)\n  // next free index to write to\n  var pos \x3d 0\n\n  def ensureCapacity(sizeToAdd: Int): Unit \x3d {\n    val cap \x3d buffer.size - pos\n    if (sizeToAdd \x3c\x3d cap) ()\n    else {\n      // Double the capacity while ensuring the required capacity\n      val newSize \x3d max(buffer.size * 2, buffer.size + sizeToAdd)\n      buffer \x3d buffer.resize(newSize)\n    }\n  }\n\n  try { prog() }\n  with StringBuffer {\n    def write(str) \x3d {\n      val bytes \x3d fromString(str)\n      ensureCapacity(bytes.size)\n      bytes.foreach { b \x3d\x3e\n        buffer.set(pos, b)\n        pos \x3d pos + 1\n      }\n      resume(())\n    }\n    def flush() \x3d {\n      // resize (\x26 copy) buffer to strip trailing zeros that otherwise would be converted into 0x00 characters\n      val str \x3d bytearray::resize(buffer, pos).toString()\n      // NOTE: Keep the `buffer` as-is (no wipe, no realloc),\n      //       just reset the `pos` in case we want to use it again.\n      pos \x3d 0\n      resume(str)\n    }\n  }\n}\n\n/// Handler for string interpolation using a string buffer\ndef s { prog: () \x3d\x3e Unit / { literal, splice[String] } }: String \x3d\n  stringBuffer {\n    try { prog(); do flush() }\n    with splice[String] { x \x3d\x3e resume(do write(x)) }\n    with literal { s \x3d\x3e resume(do write(s)) }\n  }\n\nnamespace examples {\n  def main() \x3d {\n    with stringBuffer\n\n    do write("hello")\n    do write(", world")\n    // prints `hello, world`\n    println(do flush())\n\n    // prints the empty string\n    println(do flush())\n\n    do write("Ef")\n    do write("fe")\n    do write("kt")\n    do write(" \x3d ")\n    do write("")\n    do write("Effekt")\n    // prints `Effekt \x3d Effekt`\n    println(do flush())\n  }\n}\n');
sB("common/exception.effekt",'module exception\n\nimport effekt\n\n// Exceptions\n// \x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\n\ninterface Exception[E] {\n  def raise(exception: E, msg: String): Nothing\n}\n\ndef raise[A, E](exception: E, msg: String): A / Exception[E] \x3d\n  do raise(exception, msg) match {}\n\n/**\n * Used as a type for `Exception` in functions which expect a non-empty\n * container (e.g. option or list).\n */\nrecord MissingValue()\n\ndef missingValue(): Nothing / Exception[MissingValue] \x3d\n  do raise(MissingValue(), "Missing value.")\n\n/**\n * Used as a type for `Exception` in functions where an index can be out of bounds.\n */\nrecord OutOfBounds()\n\n/**\n * Unexpected runtime exceptions that can be caught.\n */\nrecord RuntimeError()\n\ndef raise[A](msg: String): A / Exception[RuntimeError] \x3d\n  do raise(RuntimeError(), msg) match {}\n\n/**\n * Used as a type for `Exception` in functions which expect the input\n * to be formatted in a specific way.\n */\nrecord WrongFormat()\n\ndef wrongFormat(): Nothing / Exception[WrongFormat] \x3d\n  do raise(WrongFormat(), "Wrong format.")\n\ndef wrongFormat(msg: String): Nothing / Exception[WrongFormat] \x3d\n  do raise(WrongFormat(), msg)\n\n\n/**\n * A fatal runtime error that cannot be caught\n */\nextern def panic(msg: String) at io: Nothing \x3d\n  js "(function() { throw ${msg} })()"\n  chez "(raise ${msg})"\n  llvm !!!MULTILINEMARKER!!!\n    call void @c_io_println(%Pos ${msg})\n    call void @exit(i32 1)\n    ret %Pos zeroinitializer ; Unit\n  !!!MULTILINEMARKER!!!\n\n\n// Exception Handlers\n// \x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\n\n\n/**\n * Converts exceptions of (static) type E to an uncatchable panic that aborts the program\n */\ndef panicOn[E, T] { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d panic(msg) }\n\n/**\n * Reports exceptions of (static) type E to the console\n */\ndef report[E] { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d println(msg) }\n\n/**\n * Ignores exceptions of (static) type E\n */\ndef ignore[E] { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d () }\n\n/**\n * Use the default value to handle the exception of type E\n */\ndef default[E, T] { default: \x3d\x3e T } { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d default() }\n\n/**\n * Runs the finalizer and rethrows E\n */\ndef finalize[E, T] { finalizer: \x3d\x3e Unit } { prog: \x3d\x3e T / Exception[E] }: T / Exception[E] \x3d\n  try { val res \x3d prog(); finalizer(); res } with Exception[E] {\n    def raise(exception: E, msg: String) \x3d { finalizer(); do raise(exception, msg) }\n  }\n\n/**\n * A proxy value to enable partial type applications, such as:\n *\n * ```\n * with on[MissingValue].ignore; ...\n * ```\n */\nrecord on[E]()\n\ndef ignore[E](proxy: on[E]) { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  ignore[E] {prog}\n\ndef default[E, T](proxy: on[E]) { d: \x3d\x3e T } { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  default[E, T] {d} {prog}\n\ndef panic[E, T](proxy: on[E]) { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  panicOn[E, T] {prog}\n\ndef report[E](proxy: on[E]) { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  report[E] {prog}\n\ndef finalize[E, T](proxy: on[E]) { finalizer: \x3d\x3e Unit } { prog: \x3d\x3e T / Exception[E] }: T / Exception[E] \x3d\n  finalize[E, T] {finalizer} {prog}');
